import React from 'react';
import './Reset.css';
import './App.css';
import Header from './Header';
import Work from './Work';
import Home from './Home';
import Contact from './Contact';
import { Router } from 'react-router';

class App extends React.Component {
	render() {
		return (
			<div className="main">
				<Header />
				<Router />
			</div>
		);
	}
}

export default App;
